column20:
Accuracy @ T = [0, 25]°C:
   2% for P < 25bar;
   2,5% for P > 27bar
Accuracy @ T = [-5, 80]°C:
   3% for P < 25bar;
   3,5% for P > 27bar

Valid range is:
 - 0 ÷ 99 if AudioSource equals "CD Audio mode" or "Flash card mode";
 - 0 ÷ 254 if AudioSource equals "CD MP3 mode"

"Source error" means:
 - "No CD Audio present or readable" if CD Audio mode;
 - "No Flash card present or readable" if "Flash card mode";
 - "MP3 track number not available" if "CD MP3 mode".
